export const request = async (requestOptions = {}) => {
  const url = 'https://api.spaceXdata.com/v3/launches'
  const res = await fetch(url, {
    methid: 'GET',
    data: {
      limit: 100,
      ...requestOptions,
    },
  })
  const json = await res.json()
  return json
}
